      SELECT DISTINCT - 86 AS col2 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab1 (FORMAT parquet) cor1, tab2 (FORMAT parquet) AS cor2;
  - name: tab1
  - name: tab2

outputs:
  - name: q7753.out
    data: |
      -86
